class Solution {
public:
    int maxOperations(string s) {
        int no=0,ans=0;
        for(int i=0;i<s.size()-1;i++){
            if(s[i]=='1')
                no++;
            if(s[i]=='1' && s[i+1]=='0'){
                ans+=no;
            }
        }
        return ans;
    }
};
